import { useNavigate } from 'react-router-dom'
import styles from './gnb.module.scss'

const GNB = () => {
  const navigate = useNavigate()
  const onLogoClick = () => {
    navigate('/')
  }
  return (
    <nav className={styles.gnb}>
      <button onClick={onLogoClick} type='button'>
        RADI BOOKS
      </button>
      <button type='button'>개인정보</button>
    </nav>
  )
}

export default GNB
